import React from "react";
import { NavLink, Route } from "react-router-dom";

const NavBar = () => {
    return (
        <nav>
            <NavLink to="./home">Home</NavLink>
            <NavLink to="./posts">Posts</NavLink>
            <NavLink to="./profile">Profile</NavLink>
        </nav>
    )
}


export default NavBar;
